// SPDX-License-Identifier: MIT OR Apache-2.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';

contract NFTMarket is ReentrancyGuard {
  using Counters for Counters.Counter;
  Counters.Counter private _itemIds;
  Counters.Counter private _itemsSold;

  constructor() {
    owners.push(Owner(0x5Cc9B109c6Db71A04fDfbfDF9E0E9949282D9cA5, 10));
    owners.push(Owner(0xE369e09Bf7671d4e6950788E2b80E79B4d961DE7, 10));
    owners.push(Owner(0xfa0d377502C7e360Ca83F7aa33bBECf598A075fd, 10));
  }

  struct MarketItem {
    uint itemId;
    address nftContract;
    uint256 tokenId;
    address seller;
    address owner;
    uint256 price;
  }

  struct Owner {
    address wallet;
    uint8 feePercentage;
  }

  struct Auction {
    address seller;
    uint minBid;
    uint deadline;
    address highestBidAddress;
    uint highestBidAmount;
  }

  event AuctionCreated(
    address tokenAddress,
    uint tokenId,
    address seller,
    uint minBid,
    uint deadline
  );

  event MarketItemCreated (
    uint indexed itemId,
    address indexed nftContract,
    uint256 indexed tokenId,
    address seller,
    address owner,
    uint256 price
  );

  mapping(address => mapping(uint => Auction)) public auctions;
  mapping(uint256 => MarketItem) private marketItems;
  IERC20 public currency;
  Owner[] public owners;

  modifier validateBalance(
    address _sender,
    uint _amount
  ) {
    require(currency.balanceOf(_sender) > _amount, 'insufficient founds');
    _;
  }

  function getSell(
    uint256 tokenId
  ) public view returns (MarketItem memory) {
    return marketItems[tokenId];
  }

  /*
  * Permite que un usuario ponga a la venta un NFT
  * Valida que el precio de entrada sea mayor a 1
  * Genera la venta e incrementa la cantidad de items en venta
  * Hace la transferencia y emite el evento correspondiente
  */
  function createMarketItem(
    address nftContract,
    uint256 tokenId,
    uint256 price
  ) public nonReentrant {
    require(price > 0, "Price must be at least 1 wei");

    _itemIds.increment();
    uint256 itemId = _itemIds.current();

    marketItems[itemId] = MarketItem(
      itemId,
      nftContract,
      tokenId,
      msg.sender,
      address(0),
      price
    );

    IERC721(nftContract).transferFrom(msg.sender, address(this), tokenId);

    emit MarketItemCreated(
      itemId,
      nftContract,
      tokenId,
      msg.sender,
      address(0),
      price
    );
  }

  /*
  * Permite que un usuario pueda comprar un NFT a partir de un address de Smart Contract y un ID
  * Valida que el usuario tenga suficiente balance del token solicitado
  * Adicionalmente calcula las regalias correspondientes y hace las transferencias
  * Incrementa la cantidad de elementos vendidos
  */
  function buyNft(
    address _nftContract,
    uint256 _itemId
    ) public nonReentrant validateBalance(msg.sender, marketItems[_itemId].tokenId) {
    uint price = marketItems[_itemId].price;
    uint tokenId = marketItems[_itemId].tokenId;
    uint priceWithoutRoyalties = transferRoyalties(price);

    currency.transferFrom(msg.sender, marketItems[_itemId].seller, priceWithoutRoyalties);
    IERC721(_nftContract).transferFrom(address(this), msg.sender, tokenId);
    currency.transferFrom(address(this), msg.sender, tokenId);
    marketItems[_itemId].owner = msg.sender;
    _itemsSold.increment();
  }

  function transferRoyalties(uint _price) internal returns (uint) {
    uint royaltiesDiscount = 0;
    for (uint i = 0; i < owners.length; i++) {
      Owner memory owner = owners[i];
      uint calculatedAmount = (_price / owner.feePercentage);
      royaltiesDiscount += calculatedAmount;
      currency.transferFrom(msg.sender, owner.wallet, calculatedAmount);
    }
    return _price - royaltiesDiscount;
  }

  /*
  * Obtiene todos los items que fueron publicados en venta
  */
  function fetchMarketItems() public view returns (MarketItem[] memory) {
    uint itemCount = _itemIds.current();
    uint unsoldItemCount = _itemIds.current() - _itemsSold.current();
    uint currentIndex = 0;

    MarketItem[] memory items = new MarketItem[](unsoldItemCount);
    for (uint i = 0; i < itemCount; i++) {
      if (marketItems[i + 1].owner == address(0)) {
        uint currentId = marketItems[i + 1].itemId;
        MarketItem storage currentItem = marketItems[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }

    return items;
  }

  /* 
  * Obtiene un listado de los NFTs del usuario
  */
  function fetchMyNFTs() public view returns (MarketItem[] memory) {
    uint totalItemCount = _itemIds.current();
    uint itemCount = 0;
    uint currentIndex = 0;

    for (uint i = 0; i < totalItemCount; i++) {
      if (marketItems[i + 1].owner == msg.sender) {
        itemCount += 1;
      }
    }

    MarketItem[] memory items = new MarketItem[](itemCount);
    for (uint i = 0; i < totalItemCount; i++) {
      if (marketItems[i + 1].owner == msg.sender) {
        uint currentId = marketItems[i + 1].itemId;
        MarketItem storage currentItem = marketItems[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }

    return items;
  }

  /*
  * Crea una subasta para un NFT a partir de un nftContract, tokenId, minBid y deadline
  * Emite el evento de Subasta creada
  */
  function createAuction(
    address _nftContract,
    uint _tokenId,
    uint _minBid,
    uint _deadline
  ) external {
    Auction storage auction = auctions[_nftContract][_tokenId];
    require(auction.deadline == 0, 'auction already exist');
    IERC721(_nftContract).transferFrom(msg.sender, address(this), _tokenId);

    auction.seller = msg.sender;
    auction.minBid = _minBid;
    auction.deadline = _deadline;
    auction.highestBidAddress = address(0);
    auction.highestBidAmount = 0;

    emit AuctionCreated({
      tokenAddress: _nftContract,
      tokenId: _tokenId,
      seller: msg.sender,
      minBid: _minBid,
      deadline: _deadline
    });
  }

  /*
  * Abre una oferta para la subasta de un nftContract, tokenId y amount
  * Valida que el usuario tenga el balance del token correspondiente
  * Que la subasta exista y no haya finalizado y devuelve los fondos al anterior
  */
  function createBid(
    address _nftContract,
    uint _tokenId, 
    uint _amount
  ) external validateBalance(msg.sender, _amount) {
    Auction storage auction = auctions[_nftContract][_tokenId];
    require(auction.deadline != 0, 'auction does not exist');
    require(auction.deadline >= block.timestamp, 'auction is finished');
    require(auction.highestBidAmount < _amount && auction.minBid < _amount, 'bid amount is too low');
    currency.transferFrom(msg.sender, address(this), _amount);
    currency.transferFrom(address(this), auction.highestBidAddress, auction.highestBidAmount);
    auction.highestBidAddress = msg.sender;
    auction.highestBidAmount = _amount;
  }

  /*
  * Cierra la subasta a partir de un nftContract y tokenId
  * Valida que la subasta haya finalizado y si hubo un ganador o si se le tiene que devolver el NFT al vendedor
  * Se realizan las transferencias o devoluciones correspondientes y elimina la subasta
  */
  function closeAuction(
    address _nftContract,
    uint _tokenId
  ) external {
    Auction storage auction = auctions[_nftContract][_tokenId];
    require(auction.deadline != 0, 'auction does not exist');
    require(auction.deadline < block.timestamp, 'auction is not finished');
    if (auction.highestBidAmount == 0) {
      IERC721(_nftContract).transferFrom(address(this), auction.seller, _tokenId);
      delete auctions[_nftContract][_tokenId];
    } else {
      uint priceWithoutRoyalties = transferRoyalties(auction.highestBidAmount);
      currency.transferFrom(address(this), auction.seller, priceWithoutRoyalties);
      IERC721(_nftContract).transferFrom(address(this), auction.highestBidAddress, _tokenId);
      delete auctions[_nftContract][_tokenId];
    }
  }

}
